import React from 'react'

function Contact(){
    return(
        <>
            <h1 style={{textAlign:'center',marginTop:'50px'}}>Contact</h1>
            <div className='contact'>
                <input type='text'placeholder='enter your name' onChange={onchange}></input>
                <input type='text'placeholder='enter your phone-number' onChange={onchange}></input>
                <input type='text'placeholder='enter your email-id' onChange={onchange}></input>
                <input className='btn' type='submit' onChange={onchange}></input>
            </div>
        </>
    )
}

export default Contact;
